import React from 'react';

class HornedBeasts extends React.Component{
  render() {

    tt=this.props.title
    return (
        <div>
            <h1>{`${tt}`}</h1>
               <img src={this.props.imgUrl} alt={`${tt}`} title={`${tt}`}/>
               <h3>{this.props.description}</h3>
        </div>
    )
};
}
export default HornedBeasts;
